class Solution(object):
    def lengthOfLongestSubstring(self, s):
        tmp_s = ""
        cnt = 0
        i = 0
        for i in range(len(s)):
            for j in range(i, len(s)):
                # print(j)
                if s[j] not in tmp_s:
                    tmp_s += s[j]

                elif s[j] in tmp_s:
                    cnt = max(len(tmp_s), cnt)
                    tmp_s = ""
                    break
            cnt = max(len(tmp_s), cnt)
            tmp_s = ""
        cnt = max(len(tmp_s), cnt)
        return cnt


